INSERT INTO `lb_payment` VALUES ('1', '预存款', '1', 'balance', '预存款是客户在您网站上的虚拟资金帐户，在个人用户中心可以充值获得。', '/payments/logos/pay_deposit.gif', '0', '99', null, '0.00', '1', null, '3');
INSERT INTO `lb_payment` VALUES ('2', '网银在线', '1', 'chinabank', '网银在线是中国领先的电子支付解决方案提供商之一。 <a href=\"http://www.chinabank.com.cn/\" target=\"_blank\">立即申请</a>', '/payments/logos/pay_chinabank.gif', '1', '99', null, '0.00', '1', null, '1');
INSERT INTO `lb_payment` VALUES ('3', '中国银联', '1', 'unionpay', '中国银联unionpay平台接口。费率相对较低，而且支持银行数量最广泛，注意：商户的 <签名证书>和<密码加密证书>都必须放置到商城根目录下的 \"/plugins/payments/pay_unionpay/key\" 目录中。<a href=\"https://open.unionpay.com/ajweb/index\" target=\"_blank\">立即申请</a>', '/payments/logos/pay_unionpay.png', '1', '99', null, '0.00', '1', null, '1');
INSERT INTO `lb_payment` VALUES ('4', '中国银联手机网站支付', '1', 'wap_unionpay', '中国银联unionpay手机网站支付接口。费率相对较低，而且支持银行数量最广泛，注意：商户的 <签名证书>和<密码加密证书>都必须放置到商城根目录下的 \"/plugins/payments/pay_wap_unionpay/key\" 目录中。<a href=\"https://open.unionpay.com/ajweb/index\" target=\"_blank\">立即申请</a>', '/payments/logos/pay_wap_unionpay.jpg', '1', '99', null, '0.00', '1', null, '2');
INSERT INTO `lb_payment` VALUES ('5', '中国银联B2B企业支付', '1', 'b2b_unionpay', '中国银联unionpay企业对公付款接口。费率相对较低，而且支持银行数量最广泛，注意：商户的 <签名证书>和<密码加密证书>都必须放置到商城根目录下的 \"/plugins/payments/pay_b2b_unionpay/key\" 目录中。<a href=\"https://open.unionpay.com/ajweb/index\" target=\"_blank\">立即申请</a>', '/payments/logos/pay_b2b_unionpay.jpg', '1', '99', null, '0.00', '1', null, '1');
INSERT INTO `lb_payment` VALUES ('6', '银联在线', '1', 'chinapay', '银联在线chinapay平台接口。注意：商户的 <公钥文件>和<私钥文件> 都必须放置到商城根目录下的 \"/plugins/payments/pay_chinapay/key\" 目录中。<a href=\"http://www.chinapay.com/\" target=\"_blank\">立即申请</a>', '/payments/logos/pay_chinapay.png', '1', '99', null, '0.00', '1', null, '1');
INSERT INTO `lb_payment` VALUES ('7', '腾讯财付通', '1', 'tenpay', '财付通是腾讯公司创办的中国领先的在线支付平台，致力于为互联网用户和企业提供安全、便捷、专业的在线支付服务。 <a href=\"https://www.tenpay.com/v2/\" target=\"_blank\">立即申请</a>', '/payments/logos/pay_tenpay.gif', '1', '99', null, '0.00', '1', null, '1');
INSERT INTO `lb_payment` VALUES ('8', '快钱', '1', 'bill99', '快钱是国内领先的独立第三方支付企业，旨在为各类企业及个人提供安全、便捷和保密的支付清算与账务服务。 <a href=\"https://www.99bill.com/\" target=\"_blank\">立即申请</a>', '/payments/logos/pay_99bill.gif', '1', '99', null, '0.00', '1', null, '1');
INSERT INTO `lb_payment` VALUES ('9', '支付宝即时到帐', '1', 'direct_alipay', '即时到帐支付方式，买家的交易资金直接打入卖家支付宝账户，快速回笼交易资金。 <a href=\"http://www.alipay.com/\" target=\"_blank\">立即申请</a>', '/payments/logos/pay_alipay.gif', '1', '99', null, '0.00', '1', null, '1');
INSERT INTO `lb_payment` VALUES ('10', '支付宝手机网站支付', '1', 'wap_alipay', '支付宝的手机网站支付方式。需要企业账号单独签约设置密钥。不能与电脑版本的支付宝混用。<a href=\"http://www.alipay.com/\" target=\"_blank\">立即申请</a>', '/payments/logos/pay_wap_alipay.png', '0', '99', null, '0.00', '1', null, '2');
INSERT INTO `lb_payment` VALUES ('11', '贝宝', '1', 'paypal', '是全球最大的在线支付平台，同时也是目前全球贸易网上支付标准。<a href=\"https://www.paypal-biz.com/\" target=\"_blank\">立即申请</a>', '/payments/logos/pay_paypal.gif', '1', '99', null, '0.00', '1', null, '1');
INSERT INTO `lb_payment` VALUES ('12', '微信公众号支付', '1', 'wap_wechat', '微信公众号里商城专用支付接口。必须在微信客户端中使用<a href=\"https://mp.weixin.qq.com/\" target=\"_blank\">立即申请</a>', '/payments/logos/pay_wap_wechat.png', '1', '99', null, '0.00', '1', null, '2');
INSERT INTO `lb_payment` VALUES ('13', '微信扫码支付', '1', 'scan_wechat', '微信二维码支付接口，适合PC电脑支付<a href=\"https://mp.weixin.qq.com/\" target=\"_blank\">立即申请</a>', '/payments/logos/pay_scan_wechat.gif', '1', '99', null, '0.00', '1', null, '1');
INSERT INTO `lb_payment` VALUES ('14', '微信APP支付', '1', 'app_wechat', '微信APP支付接口，必须有官方打包的独立APP才可以使用此支付方式。<a href=\"https://open.weixin.qq.com/\" target=\"_blank\">立即申请</a>', '/payments/logos/pay_app_wechat.png', '1', '99', null, '0.00', '1', null, '2');
INSERT INTO `lb_payment` VALUES ('15', '线下转账', '2', 'offline', '线下转账结算，通过银行柜台，电汇等方式付款', '/payments/logos/pay_offline.gif', '1', '99', null, '0.00', '0', null, '3');
