  CONSTRAINT `lb_account_log_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `lb_user` (`id`) ON DELETE SET NULL ON UPDATE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='账户余额日志表';

