-- ----------------------------
-- Table structure for `lb_comment`
-- ----------------------------
DROP TABLE IF EXISTS `lb_comment`;
CREATE TABLE `lb_comment` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `goods_id` int(11) unsigned NOT NULL COMMENT '商品ID',
  `order_no` varchar(20) NOT NULL COMMENT '订单编号',
  `user_id` int(11) unsigned NOT NULL COMMENT '用户ID',
  `time` datetime NOT NULL COMMENT '购买时间',
  `comment_time` date NOT NULL COMMENT '评论时间',
  `contents` text COMMENT '评论内容',
  `recontents` text COMMENT '回复评论内容',
  `recomment_time` date NOT NULL COMMENT '回复评论时间',
  `point` tinyint(1) NOT NULL DEFAULT '0' COMMENT '评论的分数',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '评论状态：0：未评论 1:已评论',
  `seller_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '商家ID',
  `order_goods_id` int(11) unsigned DEFAULT NULL COMMENT '订单商品表中的ID',
  `img_str` varchar(250) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `goods_id` (`goods_id`),
  KEY `order_goods_id` (`order_goods_id`),
  KEY `user_id` (`user_id`,`status`),
  CONSTRAINT `lb_comment_ibfk_1` FOREIGN KEY (`goods_id`) REFERENCES `lb_goods` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `lb_comment_ibfk_2` FOREIGN KEY (`order_goods_id`) REFERENCES `lb_order_goods` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='商品评论表';

