  CONSTRAINT `lb_delivery_doc_ibfk_2` FOREIGN KEY (`order_id`) REFERENCES `lb_order` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='发货单';

