  `price_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '费用类型 0统一设置 1指定地区费用',
  `open_default` tinyint(1) NOT NULL DEFAULT '1' COMMENT '其他地区是否启用默认费用 1启用 0 不启用',
