  `is_prescription` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `goods_type` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `goods_id` (`goods_id`),
  KEY `user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8 COMMENT='浏览记录';

-- ----------------------------
-- Records of shop_goods_history
