-- ----------------------------
-- Table structure for `lb_goods_parameter`
-- ----------------------------
DROP TABLE IF EXISTS `lb_goods_parameter`;
CREATE TABLE `lb_goods_parameter` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '商品ID',
  `goods_id` int(11) NOT NULL DEFAULT '0' COMMENT '商品ID',
  `goodscode` varchar(250) NOT NULL COMMENT '商品编码',
  `goodsname` varchar(250) NOT NULL COMMENT '名称',
  `chemicalname` varchar(250) NOT NULL COMMENT '简称',
  `spec` varchar(250) NOT NULL COMMENT '规格',
  `medicaltype` varchar(250) NOT NULL COMMENT '剂型',
  `productor` varchar(250) NOT NULL COMMENT '生产厂家',
  `producearea` varchar(250) NOT NULL COMMENT '产地',
  `product_unit` varchar(250) NOT NULL COMMENT '单位',
  `spellcode` varchar(250) NOT NULL COMMENT '拼音',
  `barcode` varchar(250) NOT NULL COMMENT '条形码',
  `taxrate` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '税庇',
  `license` varchar(250) NOT NULL COMMENT '批文号',
  `maxsellprice` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '国家零售价',
  `wholeprice` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '批发价',
  `sellprice` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '零售价',
  `assuretype` varchar(250) NOT NULL COMMENT '医保分类',
  `classcode` varchar(250) NOT NULL COMMENT '分类编码',
  `classname` varchar(250) NOT NULL COMMENT '分类名称',
  `packnum` decimal(10,2) NOT NULL COMMENT '整件包装',
  `mediumpack` decimal(10,2) NOT NULL COMMENT '中包装',
  `lastupdate` datetime NOT NULL COMMENT '最新更新时间',
  PRIMARY KEY (`id`),
  KEY `name` (`goods_id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='商品附属表';

-- ----------------------------
-- Records of shop_goods_parameter
