  CONSTRAINT `lb_group_price_ibfk_2` FOREIGN KEY (`group_id`) REFERENCES `lb_user_group` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='记录某件商品对于某组会员的价格关系表，优先权大于组设定的折扣率';

