  `dateline` int(11) NOT NULL COMMENT '发布时间',
  PRIMARY KEY (`id`),
  KEY `cat_id` (`cat_id`),
  KEY `sort` (`sort`),
  CONSTRAINT `lb_help_ibfk_1` FOREIGN KEY (`cat_id`) REFERENCES `lb_help_category` (`id`) ON DELETE SET NULL ON UPDATE SET NULL
) ENGINE=InnoDB AUTO_INCREMENT=54 DEFAULT CHARSET=utf8 COMMENT='帮助内容';

-- ----------------------------
-- Records of shop_help
-- ----------------------------

-- ----------------------------
-- Table structure for `lb_help_category`
-- ----------------------------
DROP TABLE IF EXISTS `lb_help_category`;
CREATE TABLE `lb_help_category` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(10) NOT NULL COMMENT '标题',
  `sort` smallint(5) NOT NULL COMMENT '顺序',
  `position_left` tinyint(1) NOT NULL COMMENT '是否在帮助内容、列表页面的左侧显示',
  `position_foot` tinyint(1) NOT NULL COMMENT '是否在整站页面下方显示',
  PRIMARY KEY (`id`),
  KEY `sort` (`sort`),
  KEY `position_left` (`position_left`),
  KEY `position_foot` (`position_foot`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='帮助分类';

-- ----------------------------
-- Records of shop_help_category
-- ----------------------------

-- ----------------------------
-- Table structure for `lb_keyword`
-- ----------------------------
DROP TABLE IF EXISTS `lb_keyword`;
CREATE TABLE `lb_keyword` (
  `word` varchar(15) NOT NULL COMMENT '关键词',
  `goods_nums` int(11) NOT NULL DEFAULT '1' COMMENT '产品数量',
  `hot` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否为热门',
  `order` smallint(5) NOT NULL DEFAULT '99' COMMENT '关键词排序',
  PRIMARY KEY (`word`),
  KEY `hot` (`hot`),
  KEY `order` (`order`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='关键词';

