-- ----------------------------
-- Table structure for `lb_log_operation`
-- ----------------------------
DROP TABLE IF EXISTS `lb_log_operation`;
CREATE TABLE `lb_log_operation` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `author` varchar(80) NOT NULL COMMENT '操作人员',
  `action` varchar(200) NOT NULL COMMENT '动作',
  `content` text COMMENT '内容',
  `datetime` datetime NOT NULL COMMENT '时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=63 DEFAULT CHARSET=utf8 COMMENT='日志操作记录';

